using SeedUnions;

var client = new SeedUnionsClient();
await client.Bigunion.GetAsync("id");

using SeedUnions;

var client = new SeedUnionsClient();
await client.Bigunion.UpdateAsync(
    new BigUnion(new BigUnion.NormalSweet(new NormalSweet { Value = "value" }))
);

using SeedUnions;

var client = new SeedUnionsClient();
await client.Bigunion.UpdateManyAsync(
    new List<BigUnion>()
    {
        new BigUnion(new BigUnion.NormalSweet(new NormalSweet { Value = "value" })),
        new BigUnion(new BigUnion.NormalSweet(new NormalSweet { Value = "value" })),
    }
);

